import stylesheet from './styles.js'

export default class Home extends React.Component {
	constructor(props) {
		super(props);
		this.state = {test: 0};
	}
	render() {
		return (

			<h1 style={stylesheet.homemain}>Welcome to Star Coder</h1>

		);
	}

}
